import React from 'react'

export default function About() {
    return (
        <div className="about">
            <h3>About</h3>
            <p>ShopStyle is the world’s leading fashion and lifestyle shopping platform for influencers and consumers to search, explore and find exactly what they’re looking for - all in one place.</p>
        </div>
    )
}
